import React from "react";

function Manager() {
  // Define the Sidebar component directly within Manager
  const Sidebar = () => {
    return (
      <div className="sidebar">
        <ul>
          <li>Home</li>
          <li>About us</li>
          <li>Services</li>
          <li>Contact us</li>
        </ul>
      </div>
    );
  };

  return (
    <div>
      {/* Include the Sidebar component */}
      <Sidebar />

      {/* Main content */}
      <div>
        <h1>Hello World</h1>
        {/* Your other content goes here */}
      </div>
    </div>
  );
}

export default Manager;
